import { useEffect, useState } from "react";
import productService from "../../services/productService";
import categoryService from "../../services/categoryService";

const IMAGE_BASE_URL = "http://localhost:8080/api/public/products/image";

const ProductList = () => {
  const [products, setProducts] = useState([]);
  const [categories, setCategories] = useState([]);
  const [selectedCategory, setSelectedCategory] = useState("");
  const [keyword, setKeyword] = useState("");

  // üü¢ L·∫•y danh m·ª•c khi load trang
  useEffect(() => {
    categoryService
      .getAllCategories()
      .then((data) => setCategories(data))
      .catch((err) => console.error("‚ùå L·ªói khi t·∫£i danh m·ª•c:", err));
  }, []);

  // üü¢ L·∫•y s·∫£n ph·∫©m theo b·ªô l·ªçc
  useEffect(() => {
    const fetchProducts = async () => {
      try {
        let data;
        if (keyword.trim() !== "") {
          // üîç N·∫øu c√≥ t·ª´ kh√≥a t√¨m ki·∫øm
          data = await productService.searchProductsByKeyword(keyword.trim());
        } else if (selectedCategory) {
          // üìÇ N·∫øu c√≥ danh m·ª•c
          data = await productService.getProductsByCategory(selectedCategory);
        } else {
          // üõí M·∫∑c ƒë·ªãnh: t·∫•t c·∫£ s·∫£n ph·∫©m
          data = await productService.getAllProducts();
        }

        setProducts(data.content || data);
      } catch (err) {
        console.error("‚ùå L·ªói khi t·∫£i s·∫£n ph·∫©m:", err);
      }
    };

    fetchProducts();
  }, [selectedCategory, keyword]);

  return (
    <section className="padding-bottom">
      <header className="section-heading mb-4 text-center">
        <h3 className="title-section text-uppercase font-bold text-primary">
          üõçÔ∏è Danh s√°ch s·∫£n ph·∫©m
        </h3>
      </header>

      {/* B·ªô l·ªçc */}
      <div className="d-flex justify-content-center align-items-center mb-4 gap-3">
        <select
          className="form-select w-auto"
          value={selectedCategory}
          onChange={(e) => setSelectedCategory(e.target.value)}
        >
          <option value="">T·∫•t c·∫£ danh m·ª•c</option>
          {categories.map((c) => (
            <option key={c.category_id} value={c.category_id}>
              {c.category_name}
            </option>
          ))}
        </select>

        <input
          type="text"
          className="form-control w-25"
          placeholder="üîç T√¨m theo t√™n s·∫£n ph·∫©m..."
          value={keyword}
          onChange={(e) => setKeyword(e.target.value)}
        />
      </div>

      {/* Danh s√°ch s·∫£n ph·∫©m */}
      <div className="row">
        {products.length === 0 ? (
          <div className="text-center text-muted">Kh√¥ng c√≥ s·∫£n ph·∫©m n√†o</div>
        ) : (
          products.map((p) => (
            <div key={p.product_id} className="col-xl-3 col-lg-3 col-md-4 col-6 mb-4">
              <div className="card card-product-grid shadow-sm h-100">
                <div className="img-wrap">
                  <img
                    src={`${IMAGE_BASE_URL}/${p.image}`}
                    alt={p.product_name}
                    onError={(e) =>
                      (e.target.src =
                        "https://cdn-icons-png.flaticon.com/512/679/679922.png")
                    }
                    style={{
                      width: "100%",
                      height: "250px",
                      objectFit: "cover",
                      borderRadius: "10px",
                    }}
                  />
                </div>

                <div className="info-wrap p-3">
                  <h6 className="text-truncate">{p.product_name}</h6>
                  <p className="text-muted small mb-1">
                    {p.description?.substring(0, 40)}...
                  </p>

                  <div className="price h5 text-danger mb-0">
                    {p.special_price
                      ? `${p.special_price.toLocaleString()} ‚Ç´`
                      : `${p.price.toLocaleString()} ‚Ç´`}
                  </div>

                  {p.discount > 0 && (
                    <small className="text-success">
                      Gi·∫£m {p.discount}% so v·ªõi gi√° g·ªëc
                    </small>
                  )}
                </div>
              </div>
            </div>
          ))
        )}
      </div>
    </section>
  );
};

export default ProductList;
